import React from 'react'; 
import "./Header.css";

const Header = () => {
  return (
    <>
    <div className="left_div">

        <h2>Slack</h2>

        <ul>

            <li>Products</li>
            <li>Enterprise</li>
            <li>Resources</li>
            <li>Pricing</li>

        </ul>

    </div>
    <div className="right_div"></div>
    </>
  )
}

export default Header
